import { useEffect, useState } from "react"
import api from "../../utils/api";
import { useNavigate } from 'react-router-dom';
import mydata from "./card-data.json";
export default function Dashbord() {
    const navigate = useNavigate();
    const [loading, setLoading] = useState(true);
    useEffect(() => {
        const fetchdata = async () => {
            try {
                setLoading(true);
                const response = await api.get('/user/dashboard');
                if (!response.data.success) {
                    navigate('/');
                }
                else {
                    setLoading(false);
                }
            } catch (error) {
                // console.error("Error fetching data:", error);
                navigate('/');
            }
        }
        fetchdata();

    })
    if (loading) return <div classNameName=" d-flex justify-content-center text-center app-loader" >
        <div classNameName="loader">
        </div>
    </div>;
    return (
        <>
        { mydata.map(mydatas => 
            <div classNameName="container-fluid mt-5">
                <div className="row">
                    <div classNameName="col-sm-3">
                        <div className="card">
                            <div classNameName="text-center">
                                <img src={mydatas.image} alt="..." classNameName="imagesizeview card-img-top" />
                            </div>

                                <div className="card-body">
                                <h5 className="card-title">{mydatas.name}</h5>
                                {/* <p className="card-text text-center">status for luxury</p> */}
                                {/* <div className="container"> */}
                                    <div className="row">
                                        <div className="col">
                                            Prize
                                        </div>
                                        <div className="col">
                                        {mydatas.price}
                                        </div>
                                    </div>
                                    <div className="row mt-2">
                                        <div className="col">
                                            Quantity
                                        </div>
                                        <div className="col">
                                            <div className="btn-group" role="group" aria-label="Basic example">
                                                <a type="button" className="btn btn-outline-success"><b>-</b></a>
                                                <a type="button" className="btn  btn-outline-success disabled">Middle</a>
                                                <a type="button" className="btn btn-outline-success"><b>+</b></a>
                                            </div>
                                        </div>
                                    </div>
                                {/* </div> */}
                                {/* <a href="/" className="btn btn-primary">Go somewhere</a> */}
                            </div>


                        </div>
                    </div>
                </div>
            </div>
              )}
        </>
    )
}
